const realNumberArray = [4, 5.6, -9.8, 3.14, 42, 6, 8.34, -2];
const squareList = (arr) => {
  "use strict";
  // change code below this line
  const checkInteger = (value) => Number.isInteger(value) && value > 0;
  const integersOnly = arr.filter(checkInteger);
  const powTo2nd = (value) => Math.pow(value,2)
  const squaredIntegers = integersOnly.map(powTo2nd);
  //console.log(checkInteger(12));
  // change code above this line
  return squaredIntegers;
};
